import{_ as t,c as i,a0 as a,o as n}from"./chunks/framework.CoDf8mVe.js";const g=JSON.parse('{"title":"V1 Data Migration","description":"","frontmatter":{},"headers":[],"relativePath":"en/v1-migration.md","filePath":"en/v1-migration.md","lastUpdated":null}'),o={name:"en/v1-migration.md"};function r(s,e,l,d,c,h){return n(),i("div",null,e[0]||(e[0]=[a('<h1 id="v1-data-migration" tabindex="-1">V1 Data Migration <a class="header-anchor" href="#v1-data-migration" aria-label="Permalink to &quot;V1 Data Migration&quot;">â€‹</a></h1><p>At the beginning of 2024, Rodel Agent launched its V1 version, originally hosted at <a href="https://github.com/Richasy/RichasyAssistant" target="_blank" rel="noreferrer">Richasy/RichasyAssistant</a>.</p><p>During that period, AI services were booming, and the industry had not yet established relatively uniform standards.</p><p>The initial design of Rodel Agent at that time had significant issues in its data structure due to inadequate consideration, making it difficult to adapt to the current AI services. Therefore, I restructured the entire application and migrated it to V2.</p><p>This resulted in the data from the old version not being compatible with the new version.</p><p>Rodel Agent V2 version includes a built-in migration tool to help V1 version users migrate to V2.</p><p>After downloading the new version, users of the old version can open the working directory created by the old version.</p><p>If the <code>_secret_.db</code> file is found in the directory, Rodel Agent will begin the migration process, primarily migrating the following content:</p><ol><li>Key data</li><li>Chat history</li><li>Generated images</li></ol><p>The following data will not be migrated due to functional reasons:</p><ol><li>Local model configuration (replaced by Ollama)</li><li>Assistant (replaced by session presets and new version agents)</li><li>Translation records</li></ol><hr><p>Upon completion of the migration, Rodel Agent will restart the app. After restarting, Rodel Agent will package the V1 data content into <code>v1_backup.zip</code> and then transform the working directory into the V2 structure.</p>',13)]))}const m=t(o,[["render",r]]);export{g as __pageData,m as default};
